import React from "react";
import Card from "../Card/Card";
import "./LunarCrush.scss";

function LunarCrush(props) {
  return (
    <div className="container">
      <h1>Prices @ LunarCRUSH</h1>
      {props.lunarApi.map((api) => {
        return (
          <Card
            key={api.id}
            marketName={"LunarCRUSH"}
            coinName={api.n}
            coinPrice={api.p}
            coinSymbol={api.s}
          />
        );
      })}
    </div>
  );
}

export default LunarCrush;
